import React from 'react';
import './MobFooter.css';
import { withStyles } from '@material-ui/core/styles';
import MuiAccordion from '@material-ui/core/Accordion';
import MuiAccordionDetails from '@material-ui/core/AccordionDetails';
import MuiAccordionSummary from '@material-ui/core/AccordionSummary';

const Accordion = withStyles({
    root: {
      border: '1px solid rgba(0, 0, 0, .125)',
      color: 'white',
      backgroundColor: 'rgb(38, 38, 38)',
      boxShadow: 'none',
      '&:not(:last-child)': {
        borderBottom: 0,
      },
      '&:before': {
        display: 'none',
      },
      '&$expanded': {
        margin: 'auto',
      },
    },
    expanded: {},
  })(MuiAccordion);

  const AccordionSummary = withStyles({
    root: {
      backgroundColor: 'rgba(0, 0, 0, .03)',
      borderBottom: '1px solid rgba(0, 0, 0, .125)',
      marginBottom: -1,
      minHeight: 56,
      '&$expanded': {
        minHeight: 56,
      },
    },
    content: {
      '&$expanded': {
        margin: '12px 0',
      },
    },
    expanded: {},
  })(MuiAccordionSummary);

  const AccordionDetails = withStyles((theme) => ({
    root: {
      backgroundColor: 'white',
      padding: theme.spacing(2),
    },
  }))(MuiAccordionDetails);

function MobFooter(){
    return(
        <div className='mf-wrapper'>

            <div className='mf-button-wrapper'>
                <div className='mf-button red'>
                    <button><strong>REQUEST A QUOTE</strong></button>
                </div>
                <div className='mf-button white'>
                    <button><strong>TRADE-IN VALUE</strong></button>
                </div>
            </div>

            <div className='mf-links-wrapper'>
                <Accordion square onChange={handleChange('panel1')}>
                    <AccordionSummary expandIcon={<ExpandMoreIcon className='arrow'/>}>
                        <div className='bcmobile-summary'>
                            <div>Cars & Minivans</div>
                        </div>

                    </AccordionSummary>
                    <AccordionDetails>
                        <div className='bcmobile-details'>Hello</div>
                    </AccordionDetails>
                </Accordion>
            </div>
        </div>
    )
}

export default MobFooter;
